const TableHeader = (props) => { 
    return (
        <thead>

            {props.users.map(name=>{
            return <tr>
               <th >{name.name}</th>
               <th>Job</th>
            </tr>
          })}

        </thead>
    );
}

const TableBody = () => { 
    return (
        <tbody>
           <tr>
            <td></td>
            <td></td>
          </tr>
        </tbody>
      )
}

class Table extends Component {
    render() {
      return (
        <table>
          <TableHeader />
          <TableBody />
        </table>
      )
    }
  }

export default Table;
